import React from 'react'
import Paper from '@material-ui/core/Paper'
import CustomizedAccordions from '../CustomizedAccordions'

import Tab from '@material-ui/core/Tab';
import TabContext from '@material-ui/core/TabContext';
import TabList from '@material-ui/core/TabList';
import TabPanel from '@material-ui/core/TabPanel';

import { Switch, Route } from 'react-router-dom'

const Main = (props:{newOrder: any}) =>{

    return (
        <main className='main'>
            <Paper elevation={0} sx={{overflow: 'auto',height: '100%', width: '100%'}}>
             <Switch>
                <Route exact path='/' component={CustomizedAccordions}/>
                <Route path='/roster' component={Roster}/>
                <Route path='/schedule' component={Schedule}/>
            </Switch>
            </Paper>



        </main>
    )
}


export default Main;

